I see there hasn't been recent activity on this, so here are my two cents. 
I know nothing about internals of the ListView implementation, however.

Many Titanium users badly need to include native module-created view objects in list templates. Examples:
- Styled labels
- Admob banners
- etc

Example of how I'd like to build a child template for a banner element, to be then composed in a more complex row:

var AdMob = require('ti.admob');

var bannerTemplate =  function() {
       banner = {
        // type: 'Ti.UI.View',  
        creationMethod: AdMob.createView,
        bindId: 'banner',
        properties: {
          width: 300,
          height: 250,
          publisherId: "whatever"
        },
       events: {
          didReceiveAd:  function(e) { },
          didFailToReceiveAd:  function(e) { },
      };
      return banner;
    }

Basically, instead of specifying a string with the Ti type, we would provide the factory creator method, that could then be passed the 'properties' as params at row instantiation time.

Assuming of course that:
- the provided creationMethod is anything (module method or even js func) that returns a view or viewproxy;
- the native module is able to react to changes of its properties, if as I suspect ListView cell reuse is something like a big tree of applyProperties (ti.admob should be adapted for this).

The above may be enough for many of the use cases I've seen in Q&A and tickets.

Hey guys, quick update on this: Would it be a suitable solution to introduce a "module" key in the item-template that would define the name of the module? Doing that, we could construct the internal proxy like all others then, for example a map inside a ListView:

 !Simulator Screen Shot - iPhone 6s - 2018-01-24 at 10.47.19.png|thumbnail! 

Code:
{code:js}
var myTemplate = {
    childTemplates: [
        {
            type: 'View',
            module: 'TiMap',
            bindId: 'map',
            properties: {}
        }
    ]
};
{code}

The SDK-change to realize this is quite small, so this could be in future versions of the SDK. The only problem would be to know the actual name of the module root-class, which can differ from the actual name of the module because its generated by the module ID and not module name.

iOS-PR: https://github.com/appcelerator/titanium_mobile/pull/9767

Example:
{code:js}
var win = Ti.UI.createWindow({
  backgroundColor: 'white'
});
var map = require('ti.map');

var myTemplate = {
  childTemplates: [{
    type: 'View',
    module: map,
    bindId: 'map',
    properties: {}
  }]
};

var listView = Ti.UI.createListView({
  templates: {
    'template': myTemplate
  },
  defaultItemTemplate: 'template'
});
var sections = [];

var fruitSection = Ti.UI.createListSection({
  headerTitle: 'Fruits / Frutas'
});
var fruitDataSet = [{
  map: {
    width: Ti.UI.FILL,
    height: 50
  }
}, ];
fruitSection.setItems(fruitDataSet);
sections.push(fruitSection);

listView.setSections(sections);
win.add(listView);
win.open();
{code}

*Note*: This is only the iOS PR! To complete this request, we would need to do the same for Android.
